import React from 'react';
import styles from './NavBar.module.css'

const NavBar = () => {
    console.log(styles);
    return (
        <nav className={styles.main_nav}>
                <a className={styles.logo_img} href='localhost://3000'></a>
        </nav>
    );
};

export default NavBar;
